INSERT INTO `oc_news_description` (`news_id`, `language_id`, `title`, `meta_description`, `description`, `keyword`) VALUES
(1, 2, 'Mua trái cây Florida - Những tác dụng không ngờ của trái hồng xiêm (Sapoche)', 'Hồng xiêm là một loại trái cây có mùi thơm hấp dẫn và nhiều vitamin, khoáng chất, giá trị dinh dưỡng rất cao.', '&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Theo Đông y, hồng xiêm vị ngọt, tính mát, tác dụng dinh tân dịch, nhuận tràng, giải khát.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Còn theo Tây y, trong 100 gram trái hồng xiêm chín có chứa calories 83 mg, chất đạm 0.44 g, chất béo 1.10 g, chất xơ 1.40 g, canxi 21 mg, sắt 0.80 mg, phot pho 12 mg, potassium 193 mg, sodium 12 mg, beta-carotene (A) 60 IU, riboflavin (B2) 0.020 mg, niacin (B3) 0.200 mg, pantothenic acid (B5) 0.252 mg, Pyridoxine (B6) 0.037 mg, Ascorbic acid (C) 14.7 mgamin cùng các loại vitamin B2, B3, B5, B6, C, E…&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Ngoài vai trò là trái cây, hồng xiêm còn có khá nhiều tác dụng dược lý. Cụ thể: Potassium (100 g hồng xiêm có tới 193 mg potassium) có trong hồng xiêm có khả năng giúp giảm huyết áp. Theo các nghiên cứu khoa học, nếu cơ thể tiêu thụ một lượng vừa đủ potassium sẽ giảm được nguy cơ tăng huyết áp và hạ huyết áp đối với người đang bị tăng.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://znews-photo.d.za.zdn.vn/w660/Uploaded/erlx/2014_12_24/anh1_4.jpg&quot; style=&quot;width: 470px; height: 313px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Ngoài ra, vị ngọt của hồng xiêm là vị ngọt tự nhiên, rất ít chất sodium nên người bị bệnh huyết áp, tim mạch, bệnh thận có thể thoải mái thưởng thức loại trái cây này mà không lo bị dư thừa đường trong cơ thể.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Cũng do giàu canxi, photpho, các vitamin và khoáng chất nên hồng xiêm là lựa chọn tốt cho bà bầu và trẻ nhỏ. Bổ sung thêm hồng xiêm vào thực đơn hàng ngày sẽ giúp bà bầu, trẻ nhỏ phòng tránh được bệnh thiếu máu, thiếu canxi cùng các khoáng chất khác. Ngoài ra, lượng vitamin B5, B6, B3, B1... có trong hồng xiêm giúp cho hệ thần kinh phát triển, chống mỏi mệt và giúp giác ngủ được sâu hơn.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Cùng với đó, hồng xiêm còn là nguồn cung cấp phong phú tannin và polyphenolic – các chất có lợi cho đường tiêu hóa. Hồng xiêm sẽ giúp loại bỏ các chất thải từ dạ dày, làm sạch dạ dày, giảm tiêu chảy. Các khoáng chất dồi dào trong loại quả này cũng giúp cho việc hình thành các enzyme cần thiết trong dạ dày, từ đó điều chỉnh quá trình trao đổi chất và giữ cho đường tiêu hóa luôn sạch sẽ.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Đặc biệt, hồng xiêm còn có tác dụng trong làm đẹp da, tóc. Dầu chiết xuất từ hạt hồng xiêm giúp dưỡng ẩm và làm mềm tóc, giúp tóc óng mượt. Điều tuyệt vời của dầu hạt hồng xiêm là nó dễ dàng được các sợi tóc hấp thụ mà không để lại dầu. Vì vậy mà ngay cả khi sở hữu mái tóc nhiều dầu, bạn vẫn có thể sử dụng loại dầu dưỡng này mà không phải lo đến việc nó làm mái tóc dễ bị bẩn và sinh gàu.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Các vitamin E, C, khoáng chất và các chất chống oxy hóa có trong hồng xiêm cũng có tác dụng nuôi dưỡng làn da từ bên trong, giúp da khỏe mạnh, mịn màng, làm chậm quá trình lão hóa, giúp giảm các nếp nhăn.&lt;/p&gt;\r\n', ''),
(1, 1, 'Mua trái cây Florida - Những tác dụng không ngờ của trái hồng xiêm (Sapoche)', 'Hồng xiêm là một loại trái cây có mùi thơm hấp dẫn và nhiều vitamin, khoáng chất, giá trị dinh dưỡng rất cao.', '&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 0px 0px 18px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; float: none; width: 660px; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Theo Đông y, hồng xiêm vị ngọt, tính mát, tác dụng dinh tân dịch, nhuận tràng, giải khát.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Còn theo Tây y, trong 100 gram trái hồng xiêm chín có chứa calories 83 mg, chất đạm 0.44 g, chất béo 1.10 g, chất xơ 1.40 g, canxi 21 mg, sắt 0.80 mg, phot pho 12 mg, potassium 193 mg, sodium 12 mg, beta-carotene (A) 60 IU, riboflavin (B2) 0.020 mg, niacin (B3) 0.200 mg, pantothenic acid (B5) 0.252 mg, Pyridoxine (B6) 0.037 mg, Ascorbic acid (C) 14.7 mgamin cùng các loại vitamin B2, B3, B5, B6, C, E…&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Ngoài vai trò là trái cây, hồng xiêm còn có khá nhiều tác dụng dược lý. Cụ thể: Potassium (100 g hồng xiêm có tới 193 mg potassium) có trong hồng xiêm có khả năng giúp giảm huyết áp. Theo các nghiên cứu khoa học, nếu cơ thể tiêu thụ một lượng vừa đủ potassium sẽ giảm được nguy cơ tăng huyết áp và hạ huyết áp đối với người đang bị tăng.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://znews-photo.d.za.zdn.vn/w660/Uploaded/erlx/2014_12_24/anh1_4.jpg&quot; style=&quot;width: 470px; height: 313px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Ngoài ra, vị ngọt của hồng xiêm là vị ngọt tự nhiên, rất ít chất sodium nên người bị bệnh huyết áp, tim mạch, bệnh thận có thể thoải mái thưởng thức loại trái cây này mà không lo bị dư thừa đường trong cơ thể.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Cũng do giàu canxi, photpho, các vitamin và khoáng chất nên hồng xiêm là lựa chọn tốt cho bà bầu và trẻ nhỏ. Bổ sung thêm hồng xiêm vào thực đơn hàng ngày sẽ giúp bà bầu, trẻ nhỏ phòng tránh được bệnh thiếu máu, thiếu canxi cùng các khoáng chất khác. Ngoài ra, lượng vitamin B5, B6, B3, B1... có trong hồng xiêm giúp cho hệ thần kinh phát triển, chống mỏi mệt và giúp giác ngủ được sâu hơn.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Cùng với đó, hồng xiêm còn là nguồn cung cấp phong phú tannin và polyphenolic – các chất có lợi cho đường tiêu hóa. Hồng xiêm sẽ giúp loại bỏ các chất thải từ dạ dày, làm sạch dạ dày, giảm tiêu chảy. Các khoáng chất dồi dào trong loại quả này cũng giúp cho việc hình thành các enzyme cần thiết trong dạ dày, từ đó điều chỉnh quá trình trao đổi chất và giữ cho đường tiêu hóa luôn sạch sẽ.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Đặc biệt, hồng xiêm còn có tác dụng trong làm đẹp da, tóc. Dầu chiết xuất từ hạt hồng xiêm giúp dưỡng ẩm và làm mềm tóc, giúp tóc óng mượt. Điều tuyệt vời của dầu hạt hồng xiêm là nó dễ dàng được các sợi tóc hấp thụ mà không để lại dầu. Vì vậy mà ngay cả khi sở hữu mái tóc nhiều dầu, bạn vẫn có thể sử dụng loại dầu dưỡng này mà không phải lo đến việc nó làm mái tóc dễ bị bẩn và sinh gàu.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; text-rendering: geometricPrecision; margin: 18px 0px; padding: 0px; border: 0px; outline: 0px; font-size: 18px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; text-size-adjust: 100%; color: rgb(34, 34, 34); font-family: &amp;quot;Noto Serif&amp;quot;, serif;&quot;&gt;Các vitamin E, C, khoáng chất và các chất chống oxy hóa có trong hồng xiêm cũng có tác dụng nuôi dưỡng làn da từ bên trong, giúp da khỏe mạnh, mịn màng, làm chậm quá trình lão hóa, giúp giảm các nếp nhăn.&lt;/p&gt;\r\n', ''),
(2, 2, 'Mua trái cây tươi Florida - Mãng cầu xiêm có tác dụng gì', 'Phần lớn mọi người thường biết và sử dụng mãng cầu xiêm với mục đích mang lại giá trị dinh dưỡng cho các món ăn hoặc nước sinh tố giải khát là chủ yếu và ít người biết được mãng cầu xiêm có tác dụng gì. Để cung cấp thêm những thông tin cần thiết xoay quan', '&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px; line-height: 20.8px;&quot;&gt;Ở nước ta, nhắc đến mãng cầu ngay lập tức&amp;nbsp;người ta thường nghĩ ngay đến mãng cầu xiêm. Mãng cầu xiêm hay còn được gọi là mãng cầu gai hay na gai được gieo trồng quanh năm&amp;nbsp;ở những nơi có độ ẩm cao.&amp;nbsp;Phần quả của mãng cầu xiêm to, xung quanh có nhiều gai nhỏ, mềm.&amp;nbsp;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;Đây là loại cây ăn trái được nhiều người yêu thích bởi quả của chúng có phần thịt hơi chua chua ngọt ngọt mang lại một hương vị rất là rất đặc trưng.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px; line-height: 20.8px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://s1.img.yan.vn//YanNews/2167221/201406/20140607-0208-cong_dung_giam_can_tuyet_voi_tu_mang_cau_xiem1.jpg&quot; style=&quot;width: 500px; height: 375px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;box-sizing: border-box; color: rgb(29, 31, 31); font-size: 16px; font-family: Arial, sans-serif; line-height: 1.1; margin-bottom: 10px; margin-top: 0px; width: auto;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;Mãng cầu xiêm có tác dụng gì&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px; line-height: 20.8px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;Trong mãng cầu xiêm có chứa nhiều thành phần có lợi cho sức khỏe như: các loại&amp;nbsp;vitamin C,&amp;nbsp;B1, B2,... Không những thế mà còn có&amp;nbsp;hàm lượng canxi, kali, sắt, ... giúp bổ sung chất dinh dưỡng cho cơ thể. Sau đây, chúng ta cùng nhau tìm hiểu xem&amp;nbsp;&lt;em style=&quot;box-sizing: border-box;&quot;&gt;mãng cầu xiêm có tác dụng gì&lt;/em&gt;&amp;nbsp;nhé.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;1. Giúp&amp;nbsp;kháng và diệt&amp;nbsp;khuẩn, ngừa viêm nhiễm,&amp;nbsp;điều trị vết thương, sưng tấy:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;Các thành phần chiết xuất (sắc và&amp;nbsp;cô đặc) từ toàn bộ cây mãng cầu xiêm gồm có: vỏ, cuống, lá và rễ của loại cây này đều được dùng trong&amp;nbsp;các bài thuốc có&amp;nbsp;khả năng giúp ngăn ngừa các mầm mống gây bệnh, giải độc, kháng viêm vô cùng hiệu quả.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;2. Làm lành vết thương, mau mời sẹo&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;Khi dùng phần vỏ, rễ hoặc lá để đắp ngoài da hoặc đắp lên vùng có vết thương sẽ giúp mau kéo da, còn đối với vết thương, sẹo lồi sẽ giúp mau mờ sẹo một cách nhanh chóng.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;3. Thanh nhiệt, tăng sức đề kháng&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;Dùng trực tiếp thì mãng cầu xiêm có tác dụng như một loại nước giải khát, có khả năng tăng sức đề kháng cho cơ thể. &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;4. Đề phòng cao huyết áp, chữa sốt&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;5. Cải thiện tình trạng rối loạn bao tử&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;6. Hỗ trợ điều trị bệnh chấy rận, ngừa rụng tóc&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;7. Giảm bệnh phát ban:&lt;/span&gt;&amp;nbsp;tốt nhất nên sử dụng phần lá mãng cầu xiêm để đạt được&amp;nbsp;hiệu quả cao.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://pose.com.vn/images/baiviet/201406/Tiet-lo-dong-troi-ve-trai-mang-cau-xiem-moi-nguoi-nen-doc-ngay_196.jpg&quot; style=&quot;width: 720px; height: 297px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px; line-height: 20.8px;&quot;&gt;ĐẶC BIỆT, mãng cầu xiêm còn có tác dụng sau:&lt;/p&gt;\r\n\r\n&lt;ul style=&quot;box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; font-size: 13px; line-height: 20.8px;&quot;&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Ngăn ngừa sự hình thành và phát triển của các khối u trong cơ thể&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Có tác dụng tẩy giun và làm vệ sinh đường ruột&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Chống suy nhược, hạn chế tình trạng mệt mỏi&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Hạn chế hiện tượng rối loạn thần kinh&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;Những thắc mắc về&amp;nbsp;&lt;u style=&quot;box-sizing: border-box;&quot;&gt;mãng cầu xiêm có tác dụng gì&lt;/u&gt;&amp;nbsp;nay đã được giải đáp. Giờ đây, mãng cầu xiêm sẽ không còn là một thức uống giải khát đơn thuần mà chúng sẽ được mọi người biết đến như một loại cây mang lại nhiều giá trị dinh dưỡng khác.&lt;/p&gt;\r\n', ''),
(2, 1, 'Mua trái cây tươi Florida - Mãng cầu xiêm có tác dụng gì', 'Phần lớn mọi người thường biết và sử dụng mãng cầu xiêm với mục đích mang lại giá trị dinh dưỡng cho các món ăn hoặc nước sinh tố giải khát là chủ yếu và ít người biết được mãng cầu xiêm có tác dụng gì. Để cung cấp thêm những thông tin cần thiết xoay quan', '&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; line-height: 20.8px;&quot;&gt;Ở nước ta, nhắc đến mãng cầu ngay lập tức&amp;nbsp;người ta thường nghĩ ngay đến mãng cầu xiêm. Mãng cầu xiêm hay còn được gọi là mãng cầu gai hay na gai được gieo trồng quanh năm&amp;nbsp;ở những nơi có độ ẩm cao.&amp;nbsp;Phần quả của mãng cầu xiêm to, xung quanh có nhiều gai nhỏ, mềm.&amp;nbsp;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;Đây là loại cây ăn trái được nhiều người yêu thích bởi quả của chúng có phần thịt hơi chua chua ngọt ngọt mang lại một hương vị rất là rất đặc trưng.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; line-height: 20.8px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://s1.img.yan.vn//YanNews/2167221/201406/20140607-0208-cong_dung_giam_can_tuyet_voi_tu_mang_cau_xiem1.jpg&quot; style=&quot;width: 500px; height: 375px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;line-height: 1.1; box-sizing: border-box; color: rgb(29, 31, 31); font-size: 16px; font-family: Arial, sans-serif; margin-bottom: 10px; margin-top: 0px; width: auto;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;Mãng cầu xiêm có tác dụng gì&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; line-height: 20.8px;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; line-height: 20.8px;&quot;&gt;Trong mãng cầu xiêm có chứa nhiều thành phần có lợi cho sức khỏe như: các loại&amp;nbsp;vitamin C,&amp;nbsp;B1, B2,... Không những thế mà còn có&amp;nbsp;hàm lượng canxi, kali, sắt, ... giúp bổ sung chất dinh dưỡng cho cơ thể. Sau đây, chúng ta cùng nhau tìm hiểu xem&amp;nbsp;&lt;em style=&quot;box-sizing: border-box;&quot;&gt;mãng cầu xiêm có tác dụng gì&lt;/em&gt;&amp;nbsp;nhé.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;1. Giúp&amp;nbsp;kháng và diệt&amp;nbsp;khuẩn, ngừa viêm nhiễm,&amp;nbsp;điều trị vết thương, sưng tấy:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;Các thành phần chiết xuất (sắc và&amp;nbsp;cô đặc) từ toàn bộ cây mãng cầu xiêm gồm có: vỏ, cuống, lá và rễ của loại cây này đều được dùng trong&amp;nbsp;các bài thuốc có&amp;nbsp;khả năng giúp ngăn ngừa các mầm mống gây bệnh, giải độc, kháng viêm vô cùng hiệu quả.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;2. Làm lành vết thương, mau mời sẹo&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;Khi dùng phần vỏ, rễ hoặc lá để đắp ngoài da hoặc đắp lên vùng có vết thương sẽ giúp mau kéo da, còn đối với vết thương, sẹo lồi sẽ giúp mau mờ sẹo một cách nhanh chóng.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;3. Thanh nhiệt, tăng sức đề kháng&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;Dùng trực tiếp thì mãng cầu xiêm có tác dụng như một loại nước giải khát, có khả năng tăng sức đề kháng cho cơ thể. &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;4. Đề phòng cao huyết áp, chữa sốt&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;5. Cải thiện tình trạng rối loạn bao tử&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;6. Hỗ trợ điều trị bệnh chấy rận, ngừa rụng tóc&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;span style=&quot;box-sizing: border-box; font-size: 14px;&quot;&gt;7. Giảm bệnh phát ban:&lt;/span&gt;&amp;nbsp;tốt nhất nên sử dụng phần lá mãng cầu xiêm để đạt được&amp;nbsp;hiệu quả cao.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;http://pose.com.vn/images/baiviet/201406/Tiet-lo-dong-troi-ve-trai-mang-cau-xiem-moi-nguoi-nen-doc-ngay_196.jpg&quot; style=&quot;width: 720px; height: 297px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif; line-height: 20.8px;&quot;&gt;ĐẶC BIỆT, mãng cầu xiêm còn có tác dụng sau:&lt;/p&gt;\r\n\r\n&lt;ul style=&quot;font-size: 13px; box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-family: Arial, sans-serif; line-height: 20.8px;&quot;&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Ngăn ngừa sự hình thành và phát triển của các khối u trong cơ thể&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Có tác dụng tẩy giun và làm vệ sinh đường ruột&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Chống suy nhược, hạn chế tình trạng mệt mỏi&lt;/li&gt;\r\n	&lt;li style=&quot;box-sizing: border-box;&quot;&gt;Hạn chế hiện tượng rối loạn thần kinh&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; box-sizing: border-box; margin: 8px 0px; font-family: Arial, sans-serif;&quot;&gt;Những thắc mắc về&amp;nbsp;&lt;u style=&quot;box-sizing: border-box;&quot;&gt;mãng cầu xiêm có tác dụng gì&lt;/u&gt;&amp;nbsp;nay đã được giải đáp. Giờ đây, mãng cầu xiêm sẽ không còn là một thức uống giải khát đơn thuần mà chúng sẽ được mọi người biết đến như một loại cây mang lại nhiều giá trị dinh dưỡng khác.&lt;/p&gt;\r\n', '');
